import "./NavbarStyles.css"

import React  from "react"
import { Link } from "react-router-dom"

export const Navbar = () => {
  return (
    <div className="header">
        <Link to="/">
            <h1>Tutoring Academy</h1>
            <img src="./TAlogo.png" alt="bug" height={50} />        </Link>
    </div>
  )
}

export default Navbar;
